INSERT INTO `attended_lectures_items` VALUES (1,'1. 教师形象：着装得体（2）；教态自然大方（2）',4),(2,'2. 教学纪律: 按时上下课(3);上课时未接听手机(3)',6),(3,'3. 课堂管理：采用适当方式对学生考勤（2）；对学生玩手机、说话、睡觉等行为的管理（3）',5),(4,'4. 教学准备：教案或课件内容详实，符合规范（15）；其它工作准备充分，切实有效（5）',20),(5,'5. 语言表达：用普通话授课（普通话欠标准的酌情扣分）；讲解思路清晰，逻辑严密，声音流畅且洪亮，富有感染力',10),(6,'6. 板书或课件：与教学内容紧密结合；板书设计合理、清晰工整；课件形象直观，对PPT功能利用较充分。',10),(7,'7. 教学内容：分析论证透辟，重难点突出，能理论联系实际，注重培养学生综合素质',20),(8,'8. 教学方法：方法灵活，善于组织教学，注重互动，能主动与学生沟通交流，调动学生学习积极性',15),(9,'9. 教学效果：学生课堂反映好，培养学生分析解决问题的能力',10),(10,'1. 教师遵守教学纪律，按时上下课，上课时未进行接听手机等与教学无关的活动',10),(11,'2. 采用适当方式对学生进行考勤',10),(12,'3. 实验教材、教案或讲稿齐全',10),(13,'4. 实验仪器、设备、耗材等准备完好充分，严格填写实验运行记录表，实验环境整洁，仪器设备摆放合理',10),(14,'5. 进度与实验教学运行表相符，教学内容与实验教学大纲相符',10),(15,'6. 用普通话授课，本实验重点难点内容突出',10),(16,'7. 教学方法灵活、得当，教师准确掌握实验技术、示范动作规范熟练，能给学生思考、创新的启迪。',10),(17,'8. 关心爱护且严格要求学生，认真指导学生',10),(18,'9. 遵守实验教学规范，注意安全，能排除仪器故障和处理突发事件，保证实验正常进行，教学秩序好',10),(19,'10. 学生实验操作积极性高，动手能力强',10),(20,'3. 有规范的教案，重难点突出，课程承启性好',10),(21,'4. 教学方法运用合理，教师及时发现学生的错误，并纠正错误',10),(22,'5. 用普通话授课，口令清楚、讲解明了、示范准确到位、师生互动性强',10),(23,'6. 指导学生按照教师的要求进行练习',10),(24,'7. 教学中启发学生的独立思考，培养创新意识，调动学生的学习积极性',10),(25,'8. 教学进度与实际运行相符，教学内容与大纲相符',10),(26,'9. 教学内容充实，讲练结合紧密',10),(27,'10. 教案中有相应安全预案，教学中有强调教学',10),(28,'3. 有讲稿或课件，准备了与教学内容相关的范画、挂图及资料',10),(29,'4. 用普通话授课，讲解思路清晰，逻辑严密，声音流畅且洪亮',10),(30,'5. 对课堂教学有明确的理论讲授、技能训练要求',10),(31,'6. 体现教学大纲的要求，符合学生实际，做到知识与情感、结论与过程相衔接',10),(32,'7. 严格课堂管理，注重教书育人，热爱、关心学生',10),(33,'8. 科学组织教案，教学内容熟悉，授课认真，重视辅导答疑，热情解答学生问题',10),(34,'9. 教学方法灵活，善于组织教学，注重互动主动与学生沟通交流，激发学生参与美术学习的积极性、主动性',10),(35,'10. 有作业安排与相关要求',10);
