DROP TABLE IF EXISTS `course_selection`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `course_selection` (
  `id` varchar(35) NOT NULL,
  `course_id` varchar(10) DEFAULT NULL,
  `teacher_id` varchar(7) DEFAULT NULL,
  `class_id` varchar(10) DEFAULT NULL,
  `department` varchar(50) DEFAULT NULL,
  `classroom_id` varchar(10) DEFAULT NULL,
  `school_year` varchar(9) DEFAULT NULL,
  `semester` int DEFAULT '1',
  `week` varchar(100) DEFAULT NULL,
  `jieci` varchar(200) DEFAULT NULL,
  `biweekly` varchar(2) DEFAULT NULL,
  `starting_and_ending_weeks` varchar(50) DEFAULT NULL,
  `num_of_class` int DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_class_id_idx` (`class_id`),
  KEY `fk_course_id_idx` (`course_id`),
  KEY `fk_teacher_id_idx` (`teacher_id`),
  KEY `fk_classroom_id_idx` (`classroom_id`),
  CONSTRAINT `fk_class_id` FOREIGN KEY (`class_id`) REFERENCES `class` (`id`),
  CONSTRAINT `fk_classroom_id` FOREIGN KEY (`classroom_id`) REFERENCES `classroom` (`id`),
  CONSTRAINT `fk_course_id` FOREIGN KEY (`course_id`) REFERENCES `course` (`id`),
  CONSTRAINT `fk_teacher_id_1` FOREIGN KEY (`teacher_id`) REFERENCES `staff` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
